---
longname: "The Elder Scrolls III: Morrowind"
copyright: Â© 2002-2003 Bethesda
engine: openmw
genre: Role Playing
try_repack_from:
- ~/.local/share/openmw/data
# A lot of the content is compressed, but not all of it.
# TODO: benchmark time vs. size and find a good compromise
compress_deb: [-Zgzip, -z1]

missing_langs: [de,es,it,pl,ru]

steam:
  id: 22320
  path: common/Morrowind

gog:
  url: the_elder_scrolls_iii_morrowind_goty_edition

help_text: |
  game-data-packager currently supports English and French.
  .
  Both GOG and Steam sell English, German & French versions.
  .
  To let OpenMW know of this data package,
  you must run these commands in a shell.
  .
  $ mkdir -p ~/.config/openmw/
  $ cp /usr/share/games/morrowind-*/openmw.cfg ~/.config/openmw/
  .
  .
  Alternatively, you can point the openmw-wizard graphical tool
  provided by the openmw-launcher package to the
  /usr/share/games/morrowind-* directory.

packages:
  morrowind-en-data:
    better_versions:
      - morrowind-tribunal-en-data
      - morrowind-bloodmoon-en-data
      - morrowind-complete-en-data
    provides: morrowind-data
    lang: en
    build-depends: [openmw-launcher]
    install:
      - Morrowind assets from unshield
      - Morrowind English GOTY assets from unshield
      - Morrowind English GOTY videos

      - Morrowind.bsa?en_goty
      - Morrowind.esm?en_goty
      - Morrowind.ini?en_goty
      - Sound/Fx/REGN/rocks8.wav?morrowind

  morrowind-tribunal-en-data:
    better_versions:
      - morrowind-complete-en-data
    provides: morrowind-data
    lang: en
    build-depends: [openmw-launcher]
    install:
      - Morrowind assets from unshield
      - Morrowind English GOTY assets from unshield
      - Morrowind English GOTY videos
      - Tribunal GOTY on-disc data
      - Tribunal GOTY sounds

      - Morrowind.bsa?tribunal_goty
      - Morrowind.esm?en_goty
      - Morrowind.ini?en_goty
      - Tribunal.bsa?tribunal_goty
      - Tribunal.esm?tribunal_goty

  morrowind-bloodmoon-en-data:
    better_versions:
      - morrowind-complete-en-data
    provides: morrowind-data
    lang: en
    build-depends: [openmw-launcher]
    install:
      - Morrowind assets from unshield
      - Morrowind English GOTY assets from unshield
      - Morrowind English GOTY videos
      - Bloodmoon GOTY on-disc data
      - Bloodmoon GOTY data

      - Morrowind.bsa?en_goty
      - Morrowind.esm?en_goty
      - Morrowind.ini?en_goty
      - Sound/Fx/REGN/rocks8.wav?morrowind

  morrowind-complete-en-data:
    provides: morrowind-data
    lang: en
    build-depends: [openmw-launcher]
    install:
      - Morrowind assets from unshield
      - Morrowind English GOTY assets from unshield
      - Morrowind English GOTY videos
      - Tribunal GOTY on-disc data
      - Tribunal GOTY sounds
      - Bloodmoon GOTY on-disc data
      - Bloodmoon GOTY data

      # The recommended installation order is Morrowind, then Tribunal,
      # then Bloodmoon. This means we go back to the original version
      # of Morrowind.bsa, overwriting the patched one from Tribunal.
      - Morrowind.bsa?en_goty
      - Morrowind.esm?en_goty
      - Morrowind.ini?en_goty
      - Tribunal.bsa?tribunal_goty
      - Tribunal.esm?bloodmoon_goty
      - Bloodmoon.bsa?bloodmoon_goty
      - Bloodmoon.esm?bloodmoon_goty

  morrowind-fr-data:
    provides: morrowind-data
    lang: fr
    build-depends: [openmw-launcher]
    install:
      - Morrowind assets from unshield
      - Morrowind French assets from unshield
      - Morrowind French videos

      - Sound/Fx/REGN/rocks8.wav?morrowind
    doc:
      - Morrowind French documentation
    license:
      - license.txt?fr

files:
  Morrowind.ini?en_goty:
    install_as: Morrowind.ini.orig
    look_for:
      - Morrowind.ini
      - Morrowind.ini.orig

  Morrowind.ini?fr:
    install_as: Morrowind.ini.orig
    look_for:
      - Morrowind.ini
      - Morrowind.ini.orig

  # smcv's English "Game of the Year" 4CD copy, CD 1
  # The disc also contains groups:
  # - Morrowind English GOTY videos
  data1.cab?en_goty:
    unpack:
      format: unshield
      groups:
        - Fonts
        - Music
        - Sound
        - Splash
        # Morrowind.ini
        - App Executables
        # Morrowind.* (in Data_Files/)
        - Data Files
      other_parts:
        - data1.hdr?en_goty
        - data2.cab?en_goty
    provides:
      - Morrowind assets from unshield
      - Morrowind English GOTY assets from unshield
      - Morrowind.bsa?en_goty
      - Morrowind.esm?en_goty
      - Morrowind.ini?en_goty
      - Sound/Fx/REGN/rocks8.wav?morrowind

  # adetiste's French copy
  data1.cab?fr:
    unpack:
      format: unshield
      other_parts: ["data1.hdr?fr", "data2.cab?fr"]
    provides:
      - Morrowind assets from unshield
      - Morrowind French assets from unshield
      - license.txt?fr

  # smcv's English "Game of the Year" 4CD copy, CD 3
  # The disc also contains groups:
  # - Tribunal GOTY on-disc data
  data1.cab?tribunal_goty:
    unpack:
      format: unshield
      groups:
        - Data Files
        - Sounds
      other_parts:
        - data1.hdr?tribunal_goty
        - data2.cab?tribunal_goty
    provides:
      - Tribunal GOTY sounds

      - Morrowind.bsa?tribunal_goty
      - Morrowind.esm?en_goty
      - Tribunal.bsa?tribunal_goty
      - Tribunal.esm?tribunal_goty

  # smcv's English "Game of the Year" 4CD copy, CD 4
  # The disc also contains:
  # - Bloodmoon GOTY on-disc data
  # - Tribunal.esm?bloodmoon_goty
  data1.cab?bloodmoon_goty:
    unpack:
      format: unshield
      groups:
        - Data Files
        - Tribunal Files
      other_parts:
        - data1.hdr?bloodmoon_goty
        - data2.cab?bloodmoon_goty
    provides:
      - Bloodmoon GOTY data
      - Bloodmoon.bsa?bloodmoon_goty
      - Bloodmoon.esm?bloodmoon_goty

  # There is a copy of this in Morrowind, and a different copy in Tribunal
  # under a different name. Adjust look_for to avoid warnings.
  #
  # We should install the Morrowind version if and only if we don't have
  # Tribunal.
  Sound/Fx/REGN/rocks8.wav?morrowind:
    look_for:
      - Fx/REGN/rocks8.wav

